function createGeometry( amount ) {

	var vertices = [];

	for ( var i = 0; i < amount; i++) {

		var angle = Math.random();
		var distance = Math.random();

		// (random() * 2 - 1) is a random normalized angle
		// * distance to get the specific point

		vertices.push(
			(Math.random() * 2 - 1) * distance,
			(Math.random() * 2 - 1) * distance,
			(Math.random() * 2 - 1) * distance
		);
	}

	var geometry = new THREE.BufferGeometry();
	geometry.setAttribute( 'position', new THREE.Float32BufferAttribute( vertices, 3 ) );
	return geometry;
}

function createTexture( from, to ) {
	var canvas = document.createElement( 'canvas' );
	canvas.width = 16;
	canvas.height = 16;
	var context = canvas.getContext( '2d' );
	var gradient = context.createRadialGradient( 8, 8, 0, 8, 8, 8 );
	gradient.addColorStop( 0, from );
	gradient.addColorStop( 1, to );
	context.fillStyle = gradient;
	context.fillRect( 0, 0, canvas.width, canvas.height );
	return new THREE.CanvasTexture( canvas );
}

function createMedium(obj) {
	var geometry = createGeometry( 60 );
	var material = new THREE.PointsMaterial( {
		size: 4,
		map: createTexture( 'rgba(153,102,204,.1)', 'rgba(153,102,204,0)'  ),
		depthWrite: false,
		transparent: true
	} );
	var points = new THREE.Points( geometry, material );
	obj.add( points );

	var geometry = createGeometry( 10 );
	var material = new THREE.PointsMaterial( {
		size: 0.4,
		map: createTexture( 'rgba(205,205,255,1)', 'rgba(153,102,204,0)' ),
		blending: THREE.AdditiveBlending,
		depthWrite: false,
		transparent: true
	} );
	var points = new THREE.Points( geometry, material );
	obj.add( points );

	var geometry = createGeometry( 10 );
	var material = new THREE.PointsMaterial( {
		size: 0.25,
		map: createTexture( 'rgba(205,205,255,1)', 'rgba(153,102,204,0)' ),
		blending: THREE.AdditiveBlending,
		depthWrite: false,
		transparent: true
	} );
	var points = new THREE.Points( geometry, material );
	obj.add( points );
}

//Shift into frame
const aspectRatio = window.innerWidth / window.innerHeight;
console.log("aspectRatio:" + aspectRatio);
if(aspectRatio > 1) {
	this.position.x += aspectRatio
} else {
	this.position.x -= 1/aspectRatio
}

createMedium(this);

function update( event ) {
	this.rotateOnAxis(new THREE.Vector3(0,1,0), 0.001)
}

