function onDocumentMouseDown( event ) {

    event.preventDefault();

	var raycaster = new THREE.Raycaster(); // create once
	var mouse = new THREE.Vector2(); // create once

	mouse.x = ( event.clientX / renderer.domElement.clientWidth ) * 2 - 1;
	mouse.y = - ( event.clientY / renderer.domElement.clientHeight ) * 2 + 1;

	raycaster.setFromCamera( mouse, camera );

	var intersects = raycaster.intersectObjects( scene.children );
	for(var i = 0; i < intersects.length; i++) {
		if (intersects[i].object.name == "Singularity") {
			console.log("Touched Singularity");
			infinity();
			return;
		}
	}
	for(var i = 0; i < intersects.length; i++) {
		if(intersects[i].object.userData.url) {
			console.log("Opening " + intersects[i].object.userData.url)
			window.open(intersects[i].object.userData.url);
			return;
		}
	}
}

function onDocumentMouseMove( event ) {
	var raycaster = new THREE.Raycaster(); // create once
	var mouse = new THREE.Vector2(); // create once

	mouse.x = ( event.clientX / renderer.domElement.clientWidth ) * 2 - 1;
	mouse.y = - ( event.clientY / renderer.domElement.clientHeight ) * 2 + 1;

	raycaster.setFromCamera( mouse, camera );

	var intersects = raycaster.intersectObjects( scene.children );

	const intersectionsWithValidUrl = intersects.filter((intersection) => {
		return (!!intersection.object.userData.url || intersection.object.name == "Singularity")
	}).map(intersection => intersection.object);

	outlinePass.selectedObjects = intersectionsWithValidUrl;

	document.body.style.cursor = intersectionsWithValidUrl.length > 0 ? 'pointer' : 'auto';
};

function unboundInfinity() {
	this.getObjectByName("Nova").userData["timeToNova"] = 140;
	this.getObjectByName("Singularity").userData["timeToNova"] = 150;
	this.userData["timeToNova"] = 190;
}

const infinity = unboundInfinity.bind(this);

function unboundHandleCameraMove() {
	if(this.userData.timeToNova == undefined) {
		return;
	}
	if(this.userData.timeToNova > 0) {
		this.userData.timeToNova--;
		return;
	}
	if(this.backgroundIntensity < .06) {
		this.backgroundIntensity += .00006;
	}
	this.getObjectByName("Camera").position.lerp(new THREE.Vector3(0,3.4,8.8), 0.05);
}

const handleCameraMove = unboundHandleCameraMove.bind(this);

function update( event ) {
	handleCameraMove();
}

document.addEventListener('mousedown', onDocumentMouseDown, false );
document.addEventListener('mousemove', onDocumentMouseMove);

