function update( event ) {
	if(this.userData.timeToNova == undefined) {
		return;
	}
	if(this.userData.timeToNova > 0) {
		this.userData.timeToNova--;
		return;
	}
	if(this.material.alphaTest > 0.99) {
		this.visible = false;
		return;
	}
	this.scale.setScalar( this.scale.x * 1.03 );
	this.material.alphaTest += 0.002;
	this.material.needsUpdate = true;
}

