function update( event ) {
	if(this.userData.timeToNova == undefined) {
		this.rotateOnAxis(new THREE.Vector3(0,1,0), .01);
		return;
	} else if(this.userData.timeToNova > 50) {
		this.scale.setScalar( this.scale.x * 1.002 );
		this.rotateOnAxis(new THREE.Vector3(0,1,0), .005);
		this.userData.timeToNova--;
	} else if (this.userData.timeToNova > 0) {
		this.position.setX((Math.random()*2-1)*.1);
		this.position.setY((Math.random()*2-1)*.1);
		this.position.setZ((Math.random()*2-1)*.1);
		this.material.emissive.lerp(new THREE.Color("rgb(255, 255, 255)"), 0.01);
		this.material.emissiveIntensity = this.material.emissiveIntensity + .1
		this.material.needsUpdate = true;
		this.userData.timeToNova--;
	} else {
		if(this.scale.x == 0) {
			return;
		} else if(this.scale.x < 0.05) {
			this.scale.setScalar( 0 );
			this.visible = false;
			this.name = "TheBigBang";
			return;
		}
		this.position = new THREE.Vector3(0,0,0);
		this.parent.getObjectByName("Medium").visible = true;
		this.scale.setScalar( this.scale.x * .97 );
		this.rotateOnAxis(new THREE.Vector3(0,1,0), .1);
		this.material.alphaTest += 0.003;
	}
}
